import React, { Component } from 'react';
import Nav from './Components/Nav/Nav';
import routes from './routes';


class App extends Component {


  render() { 
    if(this.props.location.pathname !== "/"){
      return this.props.Nav;
    }

    return ( 
        <div>
            <Nav />
            {routes}
        </div>
     );
  }
}

export default App;
